(1, 'A new start of fluidbN', '153055938231403472-DFAF-4B1A-9C10-FDD1C2629912.png', '<p>A test article of fluidbN. All it contains is a very special and inspiring words that would truly change your way of thinking. These powerful and impactful sentences would make you feel proud and inspired so get ready to be amazed.... ??</p>', '2018-07-02 17:33:00', '2018-12-05 20:35:10', 1, 6, 45, 1),
