(3, 'test of article', '15305591101_z9yAsBinNQmvrb-H7gOAYg.png', 'they squinted hard enough, attendees of the International Centre for Parliamentary Studies’ annual Electoral Symposium, which took place in late May at the Troia Design Hotel, 90 minutes south of Lisbon, Portugal, could just about see the future of democracy taking shape.\r\n\r\nAs usual, credentialed participants — electoral officials from around the world, staff from various NGOs, and an array of eager vendors — could play with the latest suitcase ballot scanners, price out indelible inks, and peruse an array of tamper-resistant security seals, the time-honored instruments of elective governance.', '2018-07-02 18:18:30', '2018-12-08 19:11:04', 1, 5, 89, 1),
