(19, 'Impress the best person in god’s green earth  - yourself ?', '15308798011F08B81C-929A-4C73-BF79-3F75732D1326.png', '<p>Many times we feel how our lifes would look after certain time and how it would have looked if we had not done what we have done in the past.Thinking about your life turns out that you involve the most important person on the board, who’s that person ?!! </p>\r\n\r\n<p>Well undoubtedly that’s you. You’ll realize your worth and you’ll make one of the best decisions for yourself.</p>\r\n\r\n<p>But even if you fail or had failed doesn’t matter , all that matters is how you see yourself because if you appreciate your efforts and respect yourself you’ll always appreciate your past and learn instead of weeping around because there’s always a light in the box !! </p>\r\n\r\n<p>Try to impress the best person in the god’s green earth - yourself ??</p>', '2018-07-06 11:23:21', '2018-09-03 07:48:09', 2, 8, 57, 1),
(20, 'Maths can be fun for gen Z', '15308824663D10B048-24E8-4036-A253-0A755C2483B1.jpeg', '<p>This is a story worth reading and seeing how maths is turning happiness on </p>', '2018-07-06 12:05:41', '2018-11-28 15:22:01', 3, 7, 35, 1),
