(56, 'Master of My Fate', '1543170973abstract-art-black-and-white-348392.jpg', '<p>I wish someone would interpret my grief,</p>\r\n\r\n<p>And encourage me to toughen my belief.</p>\r\n\r\n<p>Maybe someone could feel the way I feel,</p>\r\n\r\n<p>With whom I could go along with zeal.</p>\r\n\r\n<p>What I wished was a hand to hold</p>\r\n\r\n<p>In the world so cold,</p>\r\n\r\n<p>An ear to listen,</p>\r\n\r\n<p>To take me out of my own mental prison,</p>\r\n\r\n<p>A heart to understand,</p>\r\n\r\n<p>The titles of my wonderland</p>\r\n\r\n<p>I know there will be none,</p>\r\n\r\n<p>And my wishes will remain undone.</p>\r\n\r\n<p>Nothing hurts more than expectations,</p>\r\n\r\n<p>These can kill any of the relations.</p>\r\n\r\n<p>Expectations lead to the cries of dismay,</p>\r\n\r\n<p>Tearing me down each another day.</p>\r\n\r\n<p>I wish I were emotionally strong,</p>\r\n\r\n<p>Not to ooze for someone whom I don’t belong.</p>\r\n\r\n<p>One day all my wishes will come to an end,</p>\r\n\r\n<p>That day there would be nothing to intend.</p>\r\n\r\n<p>Let me grow out of my pain,</p>\r\n\r\n<p>As a tree grows after the rain.</p>\r\n\r\n<p>I will not faint, though the way seems long,</p>\r\n\r\n<p>Hearts through suffering will grow strong.</p>\r\n\r\n<p>It doesn’t matter how narrow is the gate,</p>\r\n\r\n<p>From now I am the master of my fate!</p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>', '2018-10-31 19:08:53', '2018-12-06 17:05:56', 47, 16, 32, 1),
