(93, 'pony', '1544910776how-to-turn-your-passion-into-a-start-up-header.png', '<p>Many of them never get any speaking lines, and some never transform into humanoid robots at all. There&rsquo;s no Transformers-centric version of the Bechdel test that I know of, but someone once made a compilation of all the scenes in the first three movies &mdash; which total more than seven hours of what is technically cinematic entertainment &mdash; where giant robots actually fought each other instead of human characters. That compilation ended up being&nbsp;<a href=\"https://io9.gizmodo.com/the-transformers-trilogy-contains-only-20-minutes-of-ro-1603094507\" target=\"_blank\">just over 20 minutes long</a>.</p>\r\n\r\n<p>That is messed up, since giant robots fighting each other is essentially the entire idea of the&nbsp;<em>Transformers</em>&nbsp;franchise &mdash; or a least what it&rsquo;s supposed to be: the heroic Autobots fighting the evil Decepticons. Even if a few humans tagged along for the ride &mdash; the original Spike Witwicky in the 1980s cartoon was one of these, one of those tacked-on kid characters who spend most of their time getting kidnapped or messing things up &mdash; they were supporting characters to the main cast of Optimus Prime, Megatron, and the other robots between whom the story&rsquo;s actual conflict exists.</p>\r\n\r\n<blockquote>The Transformers don&rsquo;t take the back seat in their own movies because they are inherently bad characters.</blockquote>\r\n\r\n<p>If you&rsquo;re looking for drama because the idea of giant robots fighting doesn&rsquo;t appeal to you, well, 1) what are you doing watching&nbsp;<em>Transformers</em>&nbsp;in the first place, but 2) the fact is that the Transformers themselves are perfectly capable of delivering compelling drama, because they are compelling characters &mdash; or at least they&nbsp;<em>should</em>&nbsp;be. If you look back to virtually any of the more than 20&nbsp;<em>Transformers</em>&nbsp;cartoons that have aired since 1985, most prior to Michael Bay&rsquo;s first film, these giant robots that turn into cars and jets and assured nonsense also have personalities and hopes and fears and interests.</p>', '2018-12-15 21:52:56', '2018-12-16 15:33:16', 11, 9, 12, 1),
(94, 'Ck5 test', '1544944600F3C47F98-12B0-4D1A-8029-9F2C3C657D29.jpeg', '<p>Hi this is ck 5 test</p>', '2018-12-16 07:16:40', '2018-12-16 07:16:44', 11, 2, 1, 1),
